import React, { useState } from 'react';
import phoneIcon from './assets/phone.png';

const Menu = () => {
  const [mobileMenuOpen, setMobileMenuOpen] = useState(false);

  return (
    <nav
      className="frame-container menu-bar responsive-menu-bar"
      style={{
        background: '#FFF',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'space-between',
        padding: '0 45px',
        flexWrap: 'wrap',
        position: 'relative',
        minHeight: 80,
      }}
    >
      {/* Left: Logo */}
      <div
        className="menu-logo"
        style={{
          width: '100px',
          height: '100px',
          borderRadius: '50%',
          background: '#FFF',
          display: 'flex',
          alignItems: 'center',
          justifyContent: 'center',
          marginLeft: '32px',
        }}
      >
        <img
          src="/logo.png"
          alt="Booktranspo Logo"
          style={{ width: '90px', height: '90px', objectFit: 'contain', borderRadius: '50%', background: 'transparent' }}
        />
      </div>
      {/* Hamburger for mobile */}
      <button
        className="menu-hamburger"
        style={{
          display: 'none',
          background: 'none',
          border: 'none',
          fontSize: 32,
          cursor: 'pointer',
          marginLeft: 16,
        }}
        onClick={() => setMobileMenuOpen(!mobileMenuOpen)}
        aria-label="Toggle navigation menu"
      >
        â˜°
      </button>
      {/* Center: Navigation Links */}
      <div
        className={`menu-links${mobileMenuOpen ? ' open' : ''}`}
        style={{
          display: 'flex',
          alignItems: 'center',
          gap: '64px',
          height: '23px',
          justifyContent: 'center',
          flexWrap: 'wrap',
          overflowX: 'auto',
          transition: 'max-height 0.3s',
        }}
      >
        <a
          href="#home"
          style={{
            fontFamily: 'Sora, sans-serif',
            fontWeight: 400,
            fontSize: '18px',
            lineHeight: '23px',
            letterSpacing: '-0.05em',
            color: '#1E1E1E',
            textDecoration: 'none',
            height: '23px',
            display: 'flex',
            alignItems: 'center',
            whiteSpace: 'nowrap',
          }}
        >
          Home
        </a>
        <a
          href="#why-booktranspo"
          style={{
            fontFamily: 'Sora, sans-serif',
            fontWeight: 400,
            fontSize: '18px',
            lineHeight: '23px',
            letterSpacing: '-0.05em',
            color: '#1E1E1E',
            textDecoration: 'none',
            height: '23px',
            display: 'flex',
            alignItems: 'center',
            whiteSpace: 'nowrap',
          }}
        >
          Why Booktranspo
        </a>
        <a
          href="#delivery-partners"
          style={{
            fontFamily: 'Sora, sans-serif',
            fontWeight: 400,
            fontSize: '18px',
            lineHeight: '23px',
            letterSpacing: '-0.05em',
            color: '#1E1E1E',
            textDecoration: 'none',
            height: '23px',
            display: 'flex',
            alignItems: 'center',
            whiteSpace: 'nowrap',
          }}
        >
          Delivery Partners
        </a>
        <a
          href="#transport-partners"
          style={{
            fontFamily: 'Sora, sans-serif',
            fontWeight: 400,
            fontSize: '18px',
            lineHeight: '23px',
            letterSpacing: '-0.05em',
            color: '#1E1E1E',
            textDecoration: 'none',
            height: '23px',
            display: 'flex',
            alignItems: 'center',
            whiteSpace: 'nowrap',
          }}
        >
          Transport Partners
        </a>
        <a
          href="#join-us"
          style={{
            fontFamily: 'Sora, sans-serif',
            fontWeight: 400,
            fontSize: '18px',
            lineHeight: '23px',
            letterSpacing: '-0.05em',
            color: '#1E1E1E',
            textDecoration: 'none',
            height: '23px',
            display: 'flex',
            alignItems: 'center',
            whiteSpace: 'nowrap',
          }}
        >
          Join Us
        </a>
      </div>
      {/* Right: Phone image */}
      <div className="menu-phone" style={{ display: 'flex', alignItems: 'center', justifyContent: 'center', width: '308px', height: '110px', marginRight: '0px' }}>
        <img
          src={phoneIcon}
          alt="Contact Us"
          style={{ width: '308px', height: '110px', objectFit: 'contain', borderRadius: '100px', marginTop: '20px' }}
        />
      </div>
      <style>{`
        @media (max-width: 900px) {
          .responsive-menu-bar {
            flex-direction: column !important;
            align-items: flex-start !important;
            padding: 0 10px !important;
            height: auto !important;
          }
          .menu-logo {
            margin-left: 0 !important;
            margin-bottom: 8px;
          }
          .menu-phone {
            margin-top: 12px;
            width: 100% !important;
            justify-content: flex-start !important;
          }
          .menu-links {
            gap: 24px !important;
            width: 100%;
            margin-bottom: 8px;
            flex-wrap: wrap;
            justify-content: flex-start !important;
          }
          .menu-hamburger {
            display: block !important;
          }
          .menu-links {
            display: none !important;
            max-height: 0;
            overflow: hidden;
            transition: max-height 0.3s;
          }
          .menu-links.open {
            display: flex !important;
            max-height: 500px;
            flex-direction: column;
            gap: 16px !important;
            width: 100%;
            margin-bottom: 8px;
            background: #fff;
            box-shadow: 0 2px 8px rgba(0,0,0,0.03);
            padding: 12px 0;
          }
        }
        @media (max-width: 600px) {
          .menu-phone {
            width: 100% !important;
            height: 80px !important;
          }
          .menu-logo {
            width: 70px !important;
            height: 70px !important;
          }
        }
      `}</style>
    </nav>
  );
};

export default Menu;
